import '../App.css';
import React from 'react'
import Logo from '../Assets/bolt_logo.png'
import { Button, Navbar, Container } from 'react-bootstrap';

const Header = () => {
  return (
    <div className='Header'>
      <Navbar>
        <Container>
          <Navbar.Brand href="#home">
            <img
              alt=""
              src={Logo}
              width="45"
              height="45"
              className="d-inline-block align-top"
            />
              <Button className='Buttons' variant="outline-warning">Home</Button>{' '}
              <Button variant="outline-warning">About</Button>{' '}
              <Button variant="outline-warning">Registration</Button>{' '}
              <Button variant="outline-warning">Tournaments</Button>{' '}
              <Button variant="outline-warning">Teams</Button>{' '}
          </Navbar.Brand>
        </Container>
      </Navbar>
    </div>
  )
}

export default Header
